　建築用下地調整剤、仕上げ用パテです。<br>
　石膏ボード、ベニヤ、石綿板、ケイカル板の目地処理や、モルタル、プラスターのピンホール、穴埋め、凸凹調整。<br>
<br>
特長<br>
　すでに練ってあるパテです。<br>
　壁紙と強力に接着し、塗装仕上げ性にも優れています。<br>
　防カビ性、サンダー性に優れます。<br>
　合成樹脂系エマルジョンパテ<br>
<br>
